import React, { useState, useContext } from "react";
import AddCircleOutlineIcon from "@mui/icons-material/AddCircleOutline";
import ImageIcon from "@mui/icons-material/Image";
import ChatIcon from "@mui/icons-material/Chat";
import PeopleIcon from "@mui/icons-material/People";
import ApiIcon from "@mui/icons-material/Api";
import DescriptionIcon from "@mui/icons-material/Description";
import SmartButtonIcon from "@mui/icons-material/SmartButton";
import DeleteIcon from "@mui/icons-material/Delete";
import LinkIcon from "@mui/icons-material/Link";
import CallIcon from "@mui/icons-material/Call";
import BoltIcon from "@mui/icons-material/Bolt";
import OpenInNewIcon from "@mui/icons-material/OpenInNew";
import VideoLibraryIcon from "@mui/icons-material/VideoLibrary";
import CloseIcon from "@mui/icons-material/Close";
import {
    Box,
    Typography,
    Button,
    Menu,
    MenuItem,
    ListItemIcon,
    ListItemText,
    Drawer,
    TextField,
    IconButton,
    Select,
    FormControl,
    InputLabel
} from "@mui/material";
import { ContentContext } from '../../context/ContextProvider';

const ACTION_TYPES = [
    { id: "text", label: "Text", icon: <ChatIcon color="primary" /> },
    { id: "image", label: "Image", icon: <ImageIcon color="success" /> },
    { id: "video", label: "Video", icon: <VideoLibraryIcon color="info" /> },
    { id: "human", label: "Human Handover", icon: <PeopleIcon color="warning" /> },
    { id: "apiCall", label: "API Call", icon: <ApiIcon color="secondary" /> },
    { id: "formData", label: "Form Data", icon: <DescriptionIcon color="info" /> },
    { id: "button", label: "Buttons", icon: <SmartButtonIcon color="error" /> }
];

const BUTTON_ACTIONS = [
    { id: "sendMessage", label: "Send Message", icon: <ChatIcon /> },
    { id: "openWebsite", label: "Open Website", icon: <LinkIcon /> },
    { id: "callNumber", label: "Call Number", icon: <CallIcon /> },
    { id: "performAction", label: "Perform Action", icon: <BoltIcon /> },
    { id: "startFlow", label: "Start Another Flow", icon: <OpenInNewIcon /> },
    { id: "startStep", label: "Start Another Step", icon: <OpenInNewIcon /> },
    { id: "startExternalStep", label: "Start External Step", icon: <OpenInNewIcon /> }
];

const API_METHODS = ["GET", "POST", "PUT", "PATCH", "DELETE"];

export default function IntentActionsMenu() {
    const { themeColor, secondaryThemeColor } = useContext(ContentContext)
    const [actions, setActions] = useState([
        {
            "id": 1754810024091,
            "type": "image",
            "image": "data:image/jpeg;base64,",
            "buttons": []
        },
        {
            "id": 1754810026774,
            "type": "text",
            "content": "",
            "buttons": []
        },
        {
            "id": 1754810029264,
            "type": "video",
            "video": "",
            "buttons": []
        },
        {
            "id": 1754810031867,
            "type": "button",
            "body": "",
            "footer": "",
            "buttons": [
                {
                    "id": 1754810031867,
                    "label": "Approve order",
                    "actionType": null
                }
            ]
        },
        {
            "id": 1754810067577,
            "type": "apiCall",
            "api": {
                "method": "PUT",
                "url": "https://chatgpt.com/",
                "headers": [],
                "body": "",
                "responseMessage": ""
            }
        }
    ]);
    const [anchorEl, setAnchorEl] = useState(null);
    const [drawerOpen, setDrawerOpen] = useState(false);
    const [editingButton, setEditingButton] = useState(null);
    const [apiModalOpen, setApiModalOpen] = useState(false);
    const [apiModalTab, setApiModalTab] = useState("headers");
    const [apiModalData, setApiModalData] = useState({
        method: "POST",
        url: "",
        headers: [],
        body: "",
        responseMessage: "",
    });
    const [imagePreview, setImagePreview] = useState(null);
    const [videoPreview, setVideoPreview] = useState(null);

    const handleOpenMenu = (event) => setAnchorEl(event.currentTarget);
    const handleCloseMenu = () => setAnchorEl(null);
    const [apiCallAction, setApiCallAction] = useState(null);
    const addAction = (type) => {
        if (type === 'button') {
            setActions((prev) => [
                ...prev,
                {
                    id: Date.now(), type, body: "", footer: "", buttons: [{
                        id: Date.now(),
                        label: `Button #1`,
                        actionType: null
                    }]
                }
            ]);
        } else if (type === "apiCall") {
            setActions((pre) => [
                ...pre,
                {
                    id: Date.now(),
                    type: "apiCall",
                    api: {
                        method: "POST",
                        url: "",
                        headers: [],
                        body: "",
                        responseMessage: "",
                    }
                }

            ])
            // setApiModalOpen(true);
        } else if (type === "image") {
            setActions((prev) => [
                ...prev,
                { id: Date.now(), type, image: "", buttons: [] }
            ]);
        } else if (type === "video") {
            setActions((prev) => [
                ...prev,
                { id: Date.now(), type, video: "", buttons: [] }
            ]);
        } else {
            setActions((prev) => [
                ...prev,
                { id: Date.now(), type, content: "", buttons: [] }
            ]);
        }

        console.log(actions)
        handleCloseMenu();
    };

    const handleApiCallClick = (action) => {
        console.log("action clicked", action);
        setApiCallAction(action);
        setApiModalData({
            method: action.api?.method || "POST",
            url: action.api?.url || "",
            headers: action.api?.headers || [],
            body: action.api?.body || "",
            responseMessage: action.api?.responseMessage || "",
        });
        setApiModalOpen(true);
    };

    const updateActionContent = (id, newContent, key = "content") => {
        setActions((prev) =>
            prev.map((a) => (a.id === id ? { ...a, [key]: newContent } : a))
        );
    };

    const addButtonToAction = (actionId) => {
        setActions((prev) =>
            prev.map((a) =>
                a.id === actionId
                    ? {
                        ...a,
                        buttons: [
                            ...a.buttons,
                            {
                                id: Date.now(),
                                label: `Button #${a.buttons.length + 1}`,
                                actionType: null
                            }
                        ]
                    }
                    : a
            )
        );
    };

    const handleEditButton = (actionId, button) => {
        setEditingButton({ actionId, ...button });
        setDrawerOpen(true);
    };

    const saveButtonChanges = () => {
        setActions((prev) =>
            prev.map((a) =>
                a.id === editingButton.actionId
                    ? {
                        ...a,
                        buttons: a.buttons.map((btn) =>
                            btn.id === editingButton.id
                                ? {
                                    ...btn,
                                    label: editingButton.label,
                                    actionType: editingButton.actionType
                                }
                                : btn
                        )
                    }
                    : a
            )
        );
        setDrawerOpen(false);
        setEditingButton(null);
    };

    const deleteButton = () => {
        setActions((prev) =>
            prev.map((a) =>
                a.id === editingButton.actionId
                    ? {
                        ...a,
                        buttons: a.buttons.filter((btn) => btn.id !== editingButton.id)
                    }
                    : a
            )
        );
        setDrawerOpen(false);
        setEditingButton(null);
    };

    // Delete action card
    const deleteAction = (id) => {
        setActions((prev) => prev.filter((a) => a.id !== id));
    };

    const deleteImageHandler = (id) => {
        setActions((prev) =>
            prev.map((a) => (a.id === id ? { ...a, image: null } : a))
        );
    };

    // API Modal handlers
    const handleApiModalChange = (field, value) => {
        setApiModalData((prev) => ({ ...prev, [field]: value }));
    };

    const handleApiHeaderChange = (idx, field, value) => {
        setApiModalData((prev) => ({
            ...prev,
            headers: prev.headers.map((h, i) => i === idx ? { ...h, [field]: value } : h)
        }));
    };

    const addApiHeader = () => {
        setApiModalData((prev) => ({
            ...prev,
            headers: [...prev.headers, { key: "", value: "" }]
        }));
    };

    const removeApiHeader = (idx) => {
        setApiModalData((prev) => ({
            ...prev,
            headers: prev.headers.filter((_, i) => i !== idx)
        }));
    };

    const saveApiAction = () => {
        setActions((prev) =>
            prev.map((a) =>
                a.id === apiCallAction.id
                    ? {
                        ...a,
                        api: { ...apiModalData }
                    }
                    : a
            )
        );
        // setActions((prev) => [
        //     ...prev,
        //     {
        //         id: Date.now(),
        //         type: "apiCall",
        //         api: { ...apiModalData }
        //     }
        // ]);
        setApiModalOpen(false);
        setApiModalData({
            method: "POST",
            url: "",
            headers: [],
            body: "",
            responseMessage: "",
        });
    };

    // Image upload
    const handleImageLink = (id, url) => {
        setActions((prev) =>
            prev.map((a) => (a.id === id ? { ...a, image: url } : a))
        );
    };
    const handleImageUpload = (id, file) => {
        const reader = new FileReader();
        reader.onload = (e) => {
            setImagePreview(e.target.result);
            setActions((prev) =>
                prev.map((a) => (a.id === id ? { ...a, image: e.target.result } : a))
            );
        };
        reader.readAsDataURL(file);
    };

    // Video upload
    const handleVideoUpload = (id, file) => {
        const reader = new FileReader();
        reader.onload = (e) => {
            setVideoPreview(e.target.result);
            setActions((prev) =>
                prev.map((a) => (a.id === id ? { ...a, video: e.target.result } : a))
            );
        };
        reader.readAsDataURL(file);
    };

    return (
        <div >

            <div className="md:flex justify-between">
                <h3 className="text-lg font-medium text-gray-900">Response Configuration</h3>
                {/* <select

                    className="px-3 py-2 border border-gray-300 rounded-lg"
                >
                    <option value="en">English</option>
                    <option value="es">Spanish</option>
                    <option value="fr">French</option>
                </select> */}
                <div>

                    <Button
                        variant="contained"
                        startIcon={<AddCircleOutlineIcon />}
                        onClick={handleOpenMenu}
                        
                    >
                        Add Response
                    </Button>
                </div>
            </div>
            <div className="max-w-md mx-auto p-4 space-y-4">
                {actions.map((action) => (
                    <div
                        key={action.id}
                        className="relative p-4 border rounded-lg mb-3 cursor-pointer hover:bg-gray-100 bg-gray-50 border-gray-200 group"
                    >
                        {/* Delete cross on hover */}
                        <div
                            size="small"
                            className="absolute top-2 right-2 opacity-0 group-hover:opacity-100 transition-opacity"
                            onClick={() => deleteAction(action.id)}
                        >
                            <CloseIcon fontSize="small" />
                        </div>

                        {action.type === "text" && (
                            <>
                                <textarea
                                    rows="1"
                                    type="text"
                                    placeholder="Type a message..."
                                    value={action.content}
                                    onChange={(e) => updateActionContent(action.id, e.target.value)}
                                    className="w-full px-3 py-2 border border-none rounded-lg focus:outline-none focus:ring-1 focus:ring-gray-200"
                                />
                                <div className="bg-gray-50 rounded-xl p-3 space-y-2">
                                    {action.buttons.map((btn) => (
                                        <Button
                                            key={btn.id}
                                            variant="outlined"
                                            fullWidth
                                            onClick={() => handleEditButton(action.id, btn)}
                                        >
                                            {btn.label}
                                        </Button>
                                    ))}
                                    <Button
                                        variant="text"
                                        fullWidth
                                        onClick={() => addButtonToAction(action.id)}
                                    >
                                        + Add Button
                                    </Button>
                                </div>
                            </>
                        )}

                        {action.type === "button" && (
                            <>
                                <textarea
                                    rows="1"
                                    type="text"
                                    placeholder="Type body message..."
                                    value={action.body}
                                    onChange={(e) => updateActionContent(action.id, e.target.value, "body")}
                                    className="w-full px-3 py-2 border border-none rounded-lg focus:outline-none focus:ring-1 focus:ring-gray-200"
                                />
                                <div className="bg-gray-50 rounded-xl p-3 space-y-2">
                                    {action.buttons.map((btn) => (
                                        <Button
                                            key={btn.id}
                                            variant="outlined"
                                            fullWidth
                                            onClick={() => handleEditButton(action.id, btn)}
                                        >
                                            {btn.label}
                                        </Button>
                                    ))}
                                    <Button
                                        variant="text"
                                        fullWidth
                                        onClick={() => addButtonToAction(action.id)}
                                    >
                                        + Add Button
                                    </Button>
                                </div>
                                <textarea
                                    rows="1"
                                    type="text"
                                    placeholder="Type footer message..."
                                    value={action.footer}
                                    onChange={(e) => updateActionContent(action.id, e.target.value, "footer")}
                                    className="w-full px-3 py-2 border border-none rounded-lg focus:outline-none focus:ring-1 focus:ring-gray-200"
                                />
                            </>
                        )}

                        {action.type === "image" && (
                            <div className="border-dashed border-2 border-gray-300 rounded-lg p-6 text-center space-y-2">
                                {action.image  ? (

                                    <div className="relative">
                                        <img
                                            src={action.image}
                                            alt="Preview"
                                            className="mx-auto rounded-lg max-h-40"
                                        />
                                        <div
                                            size="small"
                                            className="absolute bottom-2 right-2 opacity-0 group-hover:opacity-100 transition-opacity"
                                            onClick={() => deleteImageHandler(action.id)}
                                        >
                                            <CloseIcon fontSize="small" />
                                        </div>
                                    </div>
                                ) : (
                                    <>
                                        <ImageIcon className="mx-auto text-gray-500" fontSize="large" />
                                        <div className="flex justify-center space-x-2 text-sm">
                                            <label className="text-blue-600 hover:underline cursor-pointer">
                                                Upload Image
                                                <input
                                                    type="file"
                                                    accept="image/*"
                                                    className="hidden"
                                                    onChange={e => handleImageUpload(action.id, e.target.files[0])}
                                                />
                                            </label>
                                            <span className="text-gray-400">or</span>
                                            <label onClick={() => handleImageLink(action.id, prompt("Enter image URL"))} className="text-blue-600 hover:underline cursor-pointer">
                                                Link
                                            </label>

                                        </div>
                                    </>
                                )}
                            </div>
                        )}

                        {action.type === "video" && (
                            <div className="border-dashed border-2 border-gray-300 rounded-lg p-6 text-center space-y-2">
                                {action.video || videoPreview ? (
                                    <video
                                        src={action.video || videoPreview}
                                        controls
                                        className="mx-auto rounded-lg max-h-40"
                                    />
                                ) : (
                                    <>
                                        <VideoLibraryIcon className="mx-auto text-gray-500" fontSize="large" />
                                        <div className="flex justify-center space-x-2 text-sm">
                                            <label className="text-blue-600 hover:underline cursor-pointer">
                                                Upload Video
                                                <input
                                                    type="file"
                                                    accept="video/*"
                                                    className="hidden"
                                                    onChange={e => handleVideoUpload(action.id, e.target.files[0])}
                                                />
                                            </label>
                                            <span className="text-gray-400">or</span>
                                            <label className="text-blue-600 hover:underline cursor-pointer">
                                                Link
                                            </label>
                                        </div>
                                    </>
                                )}
                            </div>
                        )}

                        {action.type === "apiCall" && (
                            <div onClick={() => handleApiCallClick(action)} className="border border-blue-200 rounded-lg p-4 bg-blue-50">
                                <div className="font-semibold text-blue-700 mb-2">External API Request</div>
                                <div className="text-xs text-blue-900 break-all">{action.api?.url || 'URL: https://'}</div>
                            </div>
                        )}
                        {action.type === "human" && (
                            <div className="border border-blue-200 rounded-lg p-4 bg-blue-50">
                                <div className="font-semibold text-blue-700 mb-2">Human Input</div>
                                <div className="text-xs text-blue-900 break-all">{action.human?.input || "No input provided"}</div>
                            </div>
                        )}
                    </div>
                ))}
            </div>




            <Menu anchorEl={anchorEl} open={Boolean(anchorEl)} onClose={handleCloseMenu}>
                {ACTION_TYPES.map((action) => (
                    <MenuItem key={action.id} onClick={() => addAction(action.id)}>
                        <ListItemIcon>{action.icon}</ListItemIcon>
                        <ListItemText>{action.label}</ListItemText>
                    </MenuItem>
                ))}
            </Menu>

            {/* Button Edit Drawer */}
            <Drawer anchor="right" open={drawerOpen} onClose={() => setDrawerOpen(false)}>
                <Box sx={{ width: 320, p: 2 }}>
                    <Typography variant="h6">Edit</Typography>
                    {editingButton && (
                        <>
                            <Typography variant="body2" sx={{ mt: 2 }}>
                                Button Label
                            </Typography>
                            <TextField
                                value={editingButton.label}
                                onChange={(e) =>
                                    setEditingButton({ ...editingButton, label: e.target.value })
                                }
                                fullWidth
                                size="small"
                            />

                            <Typography variant="body2" sx={{ mt: 2 }}>
                                When This Button is Pressed
                            </Typography>
                            {BUTTON_ACTIONS.map((opt) => (
                                <Button
                                    key={opt.id}
                                    fullWidth
                                    variant={
                                        editingButton.actionType === opt.id ? "contained" : "outlined"
                                    }
                                    startIcon={opt.icon}
                                    sx={{ justifyContent: "flex-start", mt: 1 }}
                                    onClick={() =>
                                        setEditingButton({ ...editingButton, actionType: opt.id })
                                    }
                                >
                                    {opt.label}
                                </Button>
                            ))}

                            <Box sx={{ display: "flex", justifyContent: "space-between", mt: 3 }}>
                                <Button
                                    variant="outlined"
                                    color="error"
                                    startIcon={<DeleteIcon />}
                                    onClick={deleteButton}
                                >
                                    Delete
                                </Button>
                                <Button variant="contained" onClick={saveButtonChanges}>
                                    Save
                                </Button>
                            </Box>
                        </>
                    )}
                </Box>
            </Drawer>

            {/* External API Modal */}
            {apiModalOpen && (
                <div className="fixed inset-0 z-50 flex items-center justify-center">
                    <div className="fixed inset-0 bg-black opacity-40" onClick={() => setApiModalOpen(false)}></div>
                    <div className="bg-white rounded-lg max-w-3xl w-full p-6 relative z-50 mx-4" onClick={e => e.stopPropagation()}>
                        <div className="flex justify-between items-center mb-4">
                            <h4 className="font-medium text-lg text-gray-800">External Request</h4>
                            <IconButton onClick={() => setApiModalOpen(false)}>
                                <CloseIcon />
                            </IconButton>
                        </div>
                        <div className="mb-4 flex gap-4">
                            <FormControl fullWidth>
                                <InputLabel>Request Type</InputLabel>
                                <Select
                                    native
                                    value={apiModalData.method}
                                    onChange={e => handleApiModalChange("method", e.target.value)}
                                >
                                    {API_METHODS.map(m => <option key={m} value={m}>{m}</option>)}
                                </Select>
                            </FormControl>
                            <TextField
                                label="Request URL"
                                value={apiModalData.url}
                                onChange={e => handleApiModalChange("url", e.target.value)}
                                fullWidth
                            />
                        </div>
                        <div className="mb-2">
                            {/* <div className="flex gap-4 mb-2">
                                <Button
                                    variant={apiModalTab === "headers" ? "contained" : "text"}
                                    onClick={() => setApiModalTab("headers")}
                                >Headers</Button>
                                <Button
                                    variant={apiModalTab === "body" ? "contained" : "text"}
                                    onClick={() => setApiModalTab("body")}
                                >Body</Button>
                                <Button
                                    variant={apiModalTab === "response" ? "contained" : "text"}
                                    onClick={() => setApiModalTab("response")}
                                >Response mapping</Button>
                                <Button
                                    variant={apiModalTab === "test" ? "contained" : "text"}
                                    onClick={() => setApiModalTab("test")}
                                >Test Now</Button>
                            </div> */}

                            <div className="flex gap-4 mb-2">
                                {[
                                    { id: "headers", label: "Headers" },
                                    { id: "body", label: "Body" },
                                    { id: "response", label: "Response mapping" },
                                    { id: "test", label: "Test Now" },
                                ].map((tab) => {
                                    const isActive = apiModalTab === tab.id;
                                    return (
                                        <button
                                            key={tab.id}
                                            onClick={() => setApiModalTab(tab.id)}
                                            className={`block md:py-3 md:px-4 p-1 border-b-2 font-medium text-sm whitespace-nowrap`}
                                            style={{
                                                borderColor: isActive ? themeColor : "transparent",
                                                color: isActive ? themeColor : "gray",
                                            }}
                                            onMouseEnter={(e) => {
                                                if (!isActive) e.currentTarget.style.color = secondaryThemeColor;
                                            }}
                                            onMouseLeave={(e) => {
                                                if (!isActive) e.currentTarget.style.color = "gray";
                                            }}
                                        >
                                            {tab.label}
                                        </button>
                                    );
                                })}
                            </div>



                            {/* Headers Tab */}
                            {apiModalTab === "headers" && (
                                <div>
                                    {apiModalData.headers.map((h, idx) => (
                                        <div key={idx} className="flex gap-2 mb-2">
                                            <TextField
                                                placeholder="Key"
                                                value={h.key}
                                                onChange={e => handleApiHeaderChange(idx, "key", e.target.value)}
                                                size="small"
                                            />
                                            <TextField
                                                placeholder="Value"
                                                value={h.value}
                                                onChange={e => handleApiHeaderChange(idx, "value", e.target.value)}
                                                size="small"
                                            />
                                            <IconButton onClick={() => removeApiHeader(idx)}><DeleteIcon fontSize="small" /></IconButton>
                                        </div>
                                    ))}
                                    <Button variant="outlined" onClick={addApiHeader}>Add</Button>
                                </div>
                            )}
                            {/* Body Tab */}
                            {apiModalTab === "body" && (
                                <TextField
                                    label="Body"
                                    multiline
                                    rows={3}
                                    value={apiModalData.body}
                                    onChange={e => handleApiModalChange("body", e.target.value)}
                                    fullWidth
                                />
                            )}
                            {/* Response Tab */}
                            {apiModalTab === "response" && (
                                <TextField
                                    label="Response mapping"
                                    multiline
                                    rows={2}
                                    value={apiModalData.responseMessage}
                                    onChange={e => handleApiModalChange("responseMessage", e.target.value)}
                                    fullWidth
                                />
                            )}
                            {/* Test Tab */}
                            {apiModalTab === "test" && (
                                <div className="text-gray-500 text-sm">Test API call here...</div>
                            )}
                        </div>
                        <div className="flex justify-end gap-2 mt-4">
                            <Button
                                className="px-4 py-2 bg-gray-200 rounded hover:bg-gray-300"
                                onClick={() => setApiModalOpen(false)}
                            >
                                Cancel
                            </Button>
                            <Button
                                className="px-4 py-2 text-white rounded"
                                variant="contained"
                                onClick={saveApiAction}
                            >
                                Save
                            </Button>
                        </div>
                    </div>
                </div>
            )}
        </div>
    );
}
